import React from "react";
import Banner from "../Components/common/Banner";
import CevizliBaklavalar from "../Components/common/CevizliBaklavalar";
import OwlCarouselVideo from "../Components/common/OwlCarouselVideo";

function CevizliBaklavalarPage() {
  return (
    <>
      <Banner />
      <CevizliBaklavalar />
      <OwlCarouselVideo />
    </>
  );
}

export default CevizliBaklavalarPage;
